data:
  definition: isolateur creux, ouvert de part en part, muni ou non d’ailettes, incluant
    les armatures d’extrémité
  examples: []
  notes:
  - Un isolateur creux peut être constitué d’un ou plusieurs éléments d’isolateurs
    assemblés d’une façon permanente.
